def checkSame(code):
    pos = 0
    for i in code:
        for j in code[pos+1:]:
            if i == j:
                return False
        pos += 1
    return True
code = ""
pos = 13
while pos < len(code):
    cur = code[pos-13:pos+1]
    if checkSame(cur):
        print(pos+1)
        break
    pos += 1